import React from "react";
import {Navbar, NavbarBrand } from "reactstrap";

import icon from "../icon.png"

export default props => {
  return (
      <div>
      <Navbar className="nav-head">
        <NavbarBrand
          className="nav-brand" style={{color:"#D22B2B", fontSize:"30px"}}
          onClick={_ => {
            props.setPage(0);
          }}
        >
         <img src={icon} alt="icon" style={{height:"1.5em",width:"1.5em",marginRight:"10px"}}/>
         Book My Table
        </NavbarBrand>
      </Navbar>
      </div>
  );
};
